import React from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './Login'
import Signup from'./Signup'
import { BrowserRouter, Route, Switch  } from 'react-router-dom';

function App() {
  return (



    <BrowserRouter>
        <Switch>
          <Route path="/Signup">
          <Signup/>
          </Route>
          <Route path="/Login">
            <Login/>
          </Route>
        </Switch>
      </BrowserRouter> 

  );
}

export default App;
